import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { NavBar } from "./components/NavBar";
import { Banner } from "./components/Banner";
import FlipBook from './components/Book';
import { Footer } from "./components/Footer";


function App() {
  const pages = [
    'https://via.placeholder.com/600x400.png',
    'https://via.placeholder.com/600x400.jpg',
    'https://via.placeholder.com/600x400.bmp',
    // Add more pages here...
  ];

  return (
    <div className="App">
       <NavBar />
      <Banner /> 
      <FlipBook pages={pages} width="600px" height="400px" />
       <Footer /> 
    </div>
  );
}

export default App;
